import React from "react";
import NavbarAdmItem from "./NavbarAdmItem";
function NavbarAdm(props){
  

    return(
        <>
       
            <ul className={props.class} id={props.id}>
               <NavbarAdmItem link="/admpage/article-create" title="Article" class={props.classChild} classActive={props.classActiveChild}/>
               <NavbarAdmItem link="/admpage/galleryCategory-create" title="Gallery Category" class={props.classChild} classActive={props.classActiveChild}/>
               <NavbarAdmItem link="/admpage/galleryImage-add" title="Image gallery" class={props.classChild} classActive={props.classActiveChild}/>
            </ul>
             
   
            
        </>

    )
}

export default NavbarAdm
